import React from 'react';
import { FaAlignCenter } from 'react-icons/fa';

const Home = () => {
    return (
        <div
            style={{
                fontFamily: 'Times New Roman'
            }}
        >
            <h1>hiiiii !</h1>
            <body class="info-text">
                <div>
                My name is <b>Logan Keener</b>, I'm a student in my fourth year at <b>UBC</b> doing Computer Science and Math among other coooool things :D
                </div>

                <div>

                <b>CURRENTLY:</b> I am taking a break from school for a co-op term! Also doing volunteer work for the <a href="https://www.artjusticeresearch.org/">A.R.T. Justice project</a>, helping create educational material for formerly incarcerated individuals.

                When I am in school, I'm interested in:
                    <li>
                        Machine learning & data analytics
                    </li>
                    <li>
                        UX accessibility
                    </li>
                    <li>
                        Queer inclusion in tech
                    </li>
                    <li>
                        Ethical AI
                    </li>
                </div>
            </body>

        </div>
        // to include on home page:
        // what I'm interested in
    );
};

export default Home;
